insert into "video_content"
values ('b49373cc-e552-11ed-b5ea-0242ac120002',
        'This movie is adapted from the novel of the same name and shows a different world where different types of creatures live. Humans, elves, dwarfs, hobbits, ours are some of them. Lord of Darkness Sharoun who created the most powerful ring to help him reign over the world. But one human king Isipdur with an alliance with the elves defeated the dark lord and took the ring so that he can destroy the evil ring. But the ring has this cursed power that whoever possessed it comes under the influence of its power and can''t let it go. The king decided to keep him to himself, relinquishing the only chance of destroying the ring. But no one can keep the ring for a long time other than its true owner as it attracts other creatures who desire for power. After Isipdur it passes to Golloum who keeps it for 500 years, but ring seeks its owner and Golloum loses it. A Hobbit named Bilbo finds it and keeps it for many years and passes it to his nephew Frodo, who decides to destroy it so that there will be no chance of Sharoun''s return. So Frodo and eight begin their journey to the cracks of doom as the birthplace of the ring is the only place where it can die. This fellowship includes four Hobbits, one wizard, one elf, one dwarf and two humans. So, through the mines of Moriah, the forests of the Elves, the river, they started their journey.',
        178, 'The Lord of the Rings: The Fellowship of the Ring', 1000,
        'An ancient Ring thought lost for centuries has been found, and through a strange twist of fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it. However, he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Boromir, and his three Hobbit friends Merry, Pippin, and Samwise. Through mountains, snow, darkness, forests, rivers and plains, facing evil and danger at every corner the Fellowship of the Ring must go. Their quest to destroy the One Ring is the only hope for the end of the Dark Lords reign.',
        12345);
insert into "video_content"
values ('4fd4bee3-dd70-4be4-b7c4-ddc83ae219ad',
        'Out in the world, one who is compelled to create is considered abnormal. Society is hard on the non-conformist. A creator may solve impossible puzzles with his brain or write symphony; he turns nothing into something. Success in his endeavor may result in the masses of society clustering at the median to call him "genius." But, beware: this means they can neither understand the achievement nor hope to equal the mind who made it. The same masses who eagerly accept his gifts with the one hand will turn around and push him into a snake pit with the other. Such is the cautionary tale of Alan Mathison Turing, master of the puzzle and father of the modern computer.',
        114, 'The Imitation Game', 100000,
        'It is based on the real life story of legendary cryptanalyst Alan Turing. The film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain''s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.',
        1000000);
INSERT INTO public.video_content (id, description, duration, name, prev_month_views, short_description, views)
VALUES ('11b6a9d6-09a8-4bca-969e-41764587fcc8',
        'During Harry Potter''s sixth year at Hogwarts, he finds a book that once belonged to the mysterious Half-Blood Prince that earns him the respect of his new Potions professor Horace Slughorn. In addition, Dumbledore must prepare Harry for the ultimate final confrontation by finding out the secret behind Voldemort''s power. Meanwhile, a hidden enemy waits in the shadows to carry out a mission given to him by the Dark Lord.',
        143, 'Harry Potter and the Half-Blood Prince', 1234,
        'During Harry Potter''s sixth year at Hogwarts, he finds a book that once belonged to the mysterious Half-Blood Prince that earns him the respect of his new Potions professor Horace Slughorn. In addition, Dumbledore must prepare Harry for the ultimate final confrontation by finding out the secret behind Voldemort''s power. Meanwhile, a hidden enemy waits in the shadows to carry out a mission given to him by the Dark Lord.',
        4321);

